;; gorilla-repl.fileformat = 1

;; **
;;; # Mastering masking
;;; 
;; **

;; @@
(ns tasteless-lagoon
  (:require
    [opencv3.core :refer :all]
    [opencv3.utils :as u]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; ## read the original picture
;; **

;; @@
(def rose
  (-> "resources/red_rose.jpg"
      (imread IMREAD_REDUCED_COLOR_2)))
(u/mat-view rose)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"246\" height=\"184\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x4c65afa7 \"BufferedImage@4c65afa7: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@4c7d1061 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 246 height = 184 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## convert the color space to HSV
;; **

;; @@
(def hsv
  (-> rose clone (cvt-color! COLOR_RGB2HSV)))

(u/mat-view hsv)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"246\" height=\"184\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x7fdf430a \"BufferedImage@7fdf430a: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@4c7d1061 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 246 height = 184 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## filter on red and create a mask from that filtering
;; **

;; @@
(def lower-red  (new-scalar 120 30 15))
(def upper-red (new-scalar 130 255 255))
(def mask (new-mat))
(in-range hsv lower-red upper-red mask)

(u/mat-view mask)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"246\" height=\"184\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x19910df1 \"BufferedImage@19910df1: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@3a1b525e transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 246 height = 184 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; **
;;; 
;; **

;; @@
(def res (new-mat))
(bitwise-and! rose res mask)
(u/mat-view res)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"246\" height=\"184\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x61f3b219 \"BufferedImage@61f3b219: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@4c7d1061 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 246 height = 184 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## adjust luminosity of the pixels selected by the mask
;; **

;; @@
; change the color by using convert-to and
; apply  original*alpha  + beta on each pixel
(def res2 (new-mat))
(convert-to res res2 -1 1 100)

(u/mat-view res2)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"246\" height=\"184\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x743a3c2b \"BufferedImage@743a3c2b: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@4c7d1061 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 246 height = 184 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
; copy the updated picture (which is the masked portion)
; to the original (a clone of)
(def cl (clone rose))
(copy-to res2 cl mask)

(u/mat-view cl)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"246\" height=\"184\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x34477552 \"BufferedImage@34477552: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@4c7d1061 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 246 height = 184 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; ## copy something completely different using the mask
;; **

;; @@
(def cl2 
  (imread "resources/emilie1.jpg"))
(def cl3 
  (clone rose))

(resize! cl2 (new-size (cols mask) (rows mask)))
(u/mat-view cl2)

(copy-to cl2 cl3 mask)

(u/mat-view cl3)
;; @@
