;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"246\" height=\"184\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x642c02b6 \"BufferedImage@642c02b6: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@4c7d1061 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 246 height = 184 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=
